import React from 'react';

// button style and details
const UserForm = (props) => {
    return(
    <form onSubmit={props.retrieveInfo}>
        <input 
        style= {{margin:"30px"}} 
        placeholder='Github Username'
        type="text" 
        name="username"
        />
        <button id="Search"> Search Username </button>
    </form>
    );
}

export default UserForm;
